    }

    square.last-move
    {
      will-change: transform;
      background-color: rgba(244, 250, 55, .45);
    }
  
    square.move-dest
    {
      background: radial-gradient(rgba(0, 0, 0, .06) 19%, rgba(0, 0, 0, 0) 20%);
      pointer-events: auto;
    }
    
      square.oc.move-dest
    {
      background: radial-gradient(rgba(0, 0, 0, 0) 50%, transparent 50%, rgba(0,0,0,0) 50%);
    }
  
    square.selected
    {
      background-color: rgba(250,255,81,0.5);
    }
        
     square.check 
    {
      background: radial-gradient( rgba(255, 0, 0, 0) 0%, rgba(0, 0, 0, 0) 25%, rgba(169, 0, 0, 0) 89%)
    }
    
    html 
    {
      font-family: "Montserrat", Sans-Serif;
    } 
  
    .coords-out coords.files 
    {
      bottom: -32px;
      text-align: center;
      font-size: 16px;
    }
    
    .coords-out coords
    {
      font-size: 16px;
    }

    piece.pawn.black { background-image: url("https://images.chesscomfiles.com/chess-themes/pieces/neo/150/bp.png")!important;} 
    piece.knight.black { background-image: url("https://images.chesscomfiles.com/chess-themes/pieces/neo/150/bn.png")!important;} 
