    piece.queen.black { background-image: url("https://images.chesscomfiles.com/chess-themes/pieces/neo/150/bq.png")!important;} 
    piece.king.black { background-image: url("https://images.chesscomfiles.com/chess-themes/pieces/neo/150/bk.png")!important;} 
    
    piece.pawn.white { background-image: url("https://images.chesscomfiles.com/chess-themes/pieces/neo/150/wp.png")!important;} 
